var title_f28_58_29610="Mammary duct fistula";
var content_f28_58_29610=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F78199%7EPC%2F58118%7EPC%2F65757%7EPC%2F75481&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F78199%7EPC%2F58118%7EPC%2F65757%7EPC%2F75481&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Mammary duct fistula",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 245px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A mammary duct fistula is a communication between a subareolar duct and the skin, usually in the periareolar area. This patient has bilateral fistulae.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Michael J Dixon, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Fistulotomy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 219px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The treatment for a mammary duct fistula is surgical, by means of excising or unroofing the fistula.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Michael J Dixon, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Post fistula excision with transverse incision",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 358px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Fistulectomy can be performed with&nbsp;an incision across the nipple, directly over the fistula.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Michael J Dixon, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Post fistula excision with a circumareolar incision",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 320px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A circumareolar incision for fistulectomy produces a satisfactory cosmetic outcome.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Michael J Dixon, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
