"       <td>",
"        I understand how each of my asthma medications works to improve my condition.",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        1",
"       </td>",
"       <td colspan=\"1\">",
"        2",
"       </td>",
"       <td colspan=\"1\">",
"        3",
"       </td>",
"       <td colspan=\"1\">",
"        4",
"       </td>",
"       <td>",
"        5",
"       </td>",
"      </tr>",
