"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        2",
"       </td>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        4",
"       </td>",
"       <td>",
"        5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        I am confident I can prevent asthma symptoms from occurring in most situations. &nbsp; &nbsp;",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        2",
"       </td>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        4",
"       </td>",
"       <td>",
"        5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        I am confident I can manage asthma symptoms when they occur.",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        2",
"       </td>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        4",
"       </td>",
"       <td>",
"        5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        I know how to monitor my airways with a peak flow meter to detect potential asthma episodes before they occur.",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        2",
"       </td>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        4",
"       </td>",
"       <td>",
"        5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Having asthma does not prevent me from doing activities that I would do if I did not have it.",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        2",
"       </td>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        4&nbsp;",
"       </td>",
"       <td>",
"        5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
