var title_f28_58_29613="Thymocyte development";
var content_f28_58_29613=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F72612&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F72612&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Thymocyte development",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 361px; height: 318px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    During thymocyte development, the T cell receptor (TCR) must engage antigen-major histocompatibility (MHC) complexes on thymic epithelium or dendritic cells. Only a certain low-affinity intracellular signaling intensity permits the developing T cells to survive and mature beyond the CD4+ CD8+ stage. This is known as positive selection. T cells expressing TCRs with very high (negative selection), or very low affinity for self peptide-MHC complexes (null selection) undergo apoptosis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Modified from: Budd RC, Fortner KA. T Lymphocytes. In: Kelley's Textbook of Rheumatology, 6th ed, Ruddy S, Harris ED, Sledge CB, et al (Eds.). W. B. Saunders Company, Philadelphia 2001. p. 116.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
